import React from "react";
import "./mix.css"; // Import your CSS file for styling

const LoadingPage = () => {
	return (
		<div className="loading-container">
			<div className="loading-spinner">
				{/* Neon-colored strips */}
				<div className="strip neon1"></div>
				<div className="strip neon2"></div>
				<div className="strip neon3"></div>
				<div className="strip neon4"></div>
				<div className="strip neon5"></div>
				{/* Add more strips with different neon colors as needed */}
			</div>
		</div>
	);
};

export default LoadingPage;
